import React from 'react';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  BarElement,
  Title,
  Tooltip,
  Legend,
} from 'chart.js';
import { Line, Bar } from 'react-chartjs-2';

ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  BarElement,
  Title,
  Tooltip,
  Legend
);

// --- DADOS E CONFIGURAÇÕES DOS GRÁFICOS ---

const lineChartData = {
  labels: ['Segunda', 'Terça', 'Quarta', 'Quinta', 'Sexta', 'Sábado', 'Domingo'],
  datasets: [
    {
      label: 'Seu Preço Médio',
      data: [25.50, 25.60, 25.45, 25.70, 25.65, 26.00, 25.90],
      borderColor: '#FF8383',
      backgroundColor: 'rgba(255, 131, 131, 0.5)',
      tension: 0.3,
    },

    {
      label: 'Média da Concorrência',
      data: [24.80, 24.90, 25.00, 24.85, 24.95, 25.10, 25.05],
      borderColor: '#A19AD3',
      backgroundColor: 'rgba(161, 154, 211, 0.5)',
      tension: 0.3,
    },
  ],
};

const barChartData = {
  labels: ['Produto A', 'Produto B', 'Produto C', 'Produto D', 'Produto E'],
  datasets: [
    {
      label: 'Seu Estoque',
      data: [50, 60, 70, 45, 80],
      backgroundColor: '#A1D6CB',
    },
    {
      label: 'Estoque Médio da Concorrência',
      data: [45, 65, 68, 50, 75],
      backgroundColor: '#FFC107',
    },
  ],
};

const chartOptions = {
  responsive: true,
  plugins: {
    legend: {
      position: 'top',
    },
    title: {
      display: true,
      font: {
        size: 16,
      }
    },
  },
};


const DashboardAnalise = () => {
  return (
    <div className="analytics-dashboard">
      <h1 className="dashboard-title">Dashboard de Análise de Mercado</h1>

      <div className="kpi-grid">

        <div className="kpi-card">
          <h4>Seu Preço Médio</h4>
          <p>R$ 25,90</p>
          <span className="kpi-trend up">+1.5%</span>
        </div>

        <div className="kpi-card">
          <h4>Média da Concorrência</h4>
          <p>R$ 25,05</p>
          <span className="kpi-trend up">+1.0%</span>
        </div>

        <div className="kpi-card">
          <h4>Oportunidades</h4>
          <p>5 Produtos</p>
          <span className="kpi-description">Onde seu preço é competitivo</span>
        </div>

        <div className="kpi-card">
          <h4>Alertas de Estoque</h4>
          <p>2 Concorrentes</p>
          <span className="kpi-description">Com estoque baixo no Produto X</span>      
        </div>

        <div className="charts-grid">

          <div className="chart-card">
            <h3 className="chart-title-header">Seu Preço vs. Concorrência (Últimos 7 dias)</h3>
            <Line options={{...chartOptions, plugins: {...chartOptions.plugins, title: { ...chartOptions.plugins.title, text: 'Evolução dos Preços'}}}} data={lineChartData} />
          </div>

          <div className="chart-card">
            <h3 className="chart-title-header">Comparativo de Estoque</h3>
            <Bar options={{...chartOptions, plugins: {...chartOptions.plugins, title: { ...chartOptions.plugins.title, text: 'Níveis de Estoque Atuais'}}}} data={barChartData} />
          </div>
        </div>
      </div>
    </div>
  );
};

export default DashboardAnalise;
